import React from 'react';

const School = () => {
    return (
        <div className="school-page">
            <h1>Kendriya Vidyalaya Gorakhpur</h1>
            <p>
                Welcome to the official page of Kendriya Vidyalaya Gorakhpur.
                This school is known for its excellence in education and
                overall development of students.
            </p>
            {/* Add more details and content about the school here */}
        </div>
    );
}

export default School;
